import path from "path";
import { createBrowserRouter } from "react-router-dom";
import App from "../App";
import ArticleDetail from "../ArticleDetail";

export const router = createBrowserRouter([
    {
        path: "/",
        element: <App/>,
        children: [
            {
                path: '/articleDetail:url',
                element: <ArticleDetail/>
            }
        ]
    }
])
